Penultimate in the TMOM2012 series, Part 11 attempts to unravel the various Conspiracy Theories we've all been involved in at some time or another.
Let's begin by 'dragging in the witnesses', as Terence so aptly puts it.
OK, he doesn't explain sunken cities or fused sand in the desert, but in matters of 
assessing situations that culture can get bogged down in, he's still the man!
